import { useAuth0 } from "@auth0/auth0-react";
import 'bootstrap/dist/css/bootstrap.min.css';
import React from 'react';
import { MdPerson } from 'react-icons/md';
import { Link } from 'react-router-dom';
import './Header.css';
import logo from './img/logo.jpeg';


function Header() {
  const { loginWithRedirect,isAuthenticated,logout } = useAuth0();


  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-secondary"> {/* Changed bg-blue to bg-primary */}
<div style={{ textAlign: 'center', margin: '' ,marginLeft: '10px'}}>
          <img src={logo} alt="App Logo" style={{ width: '40px', height: 'auto' }} />
        </div>
      <Link className="navbar-brand" to="/">Grow-Sphere</Link>      
      <button 
        className="navbar-toggler" 
        type="button" 
        data-toggle="collapse" 
        data-target="#navbarNav" 
        aria-controls="navbarNav" 
        aria-expanded="false" 
        aria-label="Toggle navigation"
      >
        <span className="navbar-toggler-icon"></span>
      </button>
      <div className="collapse navbar-collapse" id="navbarNav">
        <ul className="navbar-nav ml-auto">
          {/* <li className="nav-item">
            <Link className="nav-link" to="/home">Home</Link>
          </li> */}
          {/* <li className="nav-item">
            <Link className="nav-link" to="/about">About</Link>
          </li> */}
          {/* <li className="nav-item dropdown">
            <a 
              className="nav-link dropdown-toggle" 
              href="#" 
              id="navbarDropdown" 
              role="button" 
              data-toggle="dropdown" 
              aria-haspopup="true" 
              aria-expanded="false"
            >
              Market-Price
            </a>
            <div className="dropdown-menu" aria-labelledby="navbarDropdown">
              <a className="dropdown-item" href="#">Mumbai</a>
              <a className="dropdown-item" href="#">Another action</a>
              <div className="dropdown-divider"></div>
              <a className="dropdown-item" href="#">Something else here</a>
            </div> */}
          {/* </li>
          <li className="nav-item">
            <Link className="nav-link" to="/contact">Contact</Link>
          </li>
          <li className="nav-item">
            <Link className="nav-link" to="/map">Map</Link>
          </li> */}
          <li className="nav-item">
            <form className="form-inline my-1 my-lg-0"> {/* Adjusted class names for Bootstrap 4 */}
              <input 
                className="form-control mr-sm-6" 
                type="search" 
                placeholder="Search" 
                aria-label="Search" 
              />
              <button className="btn btn-outline-dark my-2 my-sm-0" style={{marginRight:'10px'} } type="submit">Search</button>
            </form>
          </li>
          <li>
          {
          isAuthenticated ?(
            <li>  <button className="logout" onClick={() => logout({ logoutParams: { returnTo: window.location.origin } })}>
            LogOut
          </button></li>
          ):


          ( <li> <button className="login" onClick={() => loginWithRedirect()}>Login</button> </li>)

}




          </li>

          <li className="nav-item">
            <Link className="nav-link d-flex align-items-center" to="/profile">
              <MdPerson className='pro' style={{ color: 'white', fontSize: '20px', marginRight: '5px' }} />
              SignUp
            </Link>
          </li>

        </ul>
      </div>
    </nav>
  );
}

export default Header;
